@Matheus Eiji Eu poderia perder meu tempo aqui analisando dado por dado do que você apresentou pra relacionar liberalismo e sucesso no controle da pandemia. Acho que na relação do funcionalismo público já mostrei meu ponto. Podemos discutir n fatores que mostram que países em melhor situação (especialmente em crises) são os que tem Estado forte. A Coreia do Sul investe dinheiro público até em boy Band e, surpresa, funciona.
 Quanto a ser liberal e defender saúde pública universal, vejo uma evidente contradição teórica, e mais ainda, uma prática asquerosa, mas não vou ficar aqui discutindo semântica.
O Brasil não se mete em tudo. Pedi exemplos e me vieram com emplacamento de carro e fábricas imaginárias de clips. Tenho esperança que essa joça de uma oportunidade pra todos reverem suas posições. Esperança é a última que morre.

